import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCircleCheck } from '@fortawesome/free-regular-svg-icons';
import './Login.css';

function Login() {
  const [hospitalName, setHospitalName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle login logic here
    console.log('Hospital Name:', hospitalName);
    console.log('Email:', email);
    console.log('Password:', password);
  };

  return (
    <div className='login-container'>
      <h1 className='login-header'>Login As Hospitals</h1>
      <form className='login-form' onSubmit={handleSubmit}>
        <div className='login-input-container'>
          <label htmlFor='hospitalName' className='login-label'>Hospital Name:</label>
          <input
            type='text'
            id='hospitalName'
            name='hospitalName'
            className='login-input'
            value={hospitalName}
            onChange={(e) => setHospitalName(e.target.value)} placeholder='Type Here'
            required
          />
        </div>
        <div className='login-input-container'>
          <label htmlFor='email' className='login-label'>Email:</label>
          <input
            type='email'
            id='email'
            name='email'
            className='login-input'
            value={email}
            onChange={(e) => setEmail(e.target.value)} placeholder='Enter email address'
            required
          />
        </div>
        <div className='login-input-container'>
          <label htmlFor='password' className='login-label'>Password:</label>
          <input
            type='password'
            id='password'
            name='password'
            className='login-input'
            value={password}
            onChange={(e) => setPassword(e.target.value)} placeholder='Password'
            required
          />
        </div>
        <button type='submit' className='login-button'>
          Login <FontAwesomeIcon icon={faCircleCheck} />
        </button>
      </form>
    </div>
  );
}

export default Login;
